import Reat, { useState } from 'react';
import './App.css';


function App() {
const [todos, setTodos] = useState(["wtf","i am fucking great coder","thinking of buying a laptop"])
const [input, setInput] = useState("");
console.log('#',input);

const addToDo = (event) => {
  setTodos([...todos, input]);
}

  return (
    <div className="App">
     <h1>Hello World!</h1>
    <form>
    <input value={input} onChange={event => setInput(event.target.value)}/>
    <button type="submit" onClick={addToDo}>Add Todo</button>
    </form>
    <ul>
      {todos.map(todo => (
        <li>{todo}</li>
        ))}
    </ul>

    </div>
  )
}

export default App;
